import React, { useEffect, useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import AboutPage from './AboutPage';

const JRAutoDetailing = () => {
  const [step, setStep] = useState(0);
  const [showNavbar, setShowNavbar] = useState(false);

  useEffect(() => {
    const timer = setTimeout(() => {
      setStep(1);
    }, 1500);
    return () => clearTimeout(timer);
  }, []);

  const handleAnimationComplete = () => {
    setTimeout(() => {
      setStep(2);
    }, 4000);
  };

  const handleServiceAnimationComplete = () => {
    setTimeout(() => {
      setShowNavbar(true);
    }, 1000);
  };

  const variants = {
    hidden: { opacity: 0, y: 50 },
    visible: { 
      opacity: 1, 
      y: 0, 
      transition: { duration: 1, ease: "easeOut" }
    },
    exit: { 
      opacity: 0, 
      y: -50, 
      transition: { duration: 1, ease: "easeIn" }
    },
  };

  const serviceBackgroundVariants = {
    hidden: { opacity: 0 },
    visible: { 
      opacity: 1, 
      transition: { duration: 1.5, ease: "easeOut" }
    },
  };

  const textVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { 
      opacity: 1, 
      y: 0, 
      transition: { duration: 0.8, ease: "easeOut" }
    },
  };

  return (
    <div className="relative w-full h-screen bg-stone-900 overflow-hidden font-sans">
      <AnimatePresence mode="wait">
        {step === 0 && (
          <motion.div
            key="background"
            initial="hidden"
            animate="visible"
            exit="exit"
            variants={variants}
            className="absolute inset-0 bg-stone-900"
          />
        )}
        {step === 1 && (
          <motion.div
            key="image"
            initial="hidden"
            animate="visible"
            exit="exit"
            variants={variants}
            className="absolute inset-0 flex flex-col items-center justify-center text-stone-100"
            onAnimationComplete={handleAnimationComplete}
          >
            <motion.div 
              variants={textVariants}
              className="text-sm mb-4 tracking-widest"
            >
              LOCATED IN SURREY, B.C.
            </motion.div>
            <motion.div 
              variants={textVariants}
              className="text-7xl font-bold mb-6 tracking-tight"
              style={{ fontFamily: "'Helvetica Neue', Arial, sans-serif" }}
            >
              JR AUTO DETAILING
            </motion.div>
            <motion.div 
              variants={textVariants}
              className="text-xl mb-4 tracking-wide"
            >
              PREMIUM CAR CARE EXPERIENCE
            </motion.div>
            <motion.div 
              variants={textVariants}
              className="text-sm tracking-widest"
            >
              SERVING THE LOWER MAINLAND
            </motion.div>
          </motion.div>
        )}
        {step === 2 && (
          <>
            <motion.div
              key="serviceBackground"
              initial="hidden"
              animate="visible"
              variants={serviceBackgroundVariants}
              className="absolute inset-0 bg-stone-800"
            />
            <motion.div
              key="serviceContent"
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ delay: 0.5, duration: 1 }}
              className="absolute inset-0 overflow-auto"
              onAnimationComplete={handleServiceAnimationComplete}
            >
              <AboutPage />
            </motion.div>
          </>
        )}
      </AnimatePresence>

      <AnimatePresence>
        {showNavbar && (
          <motion.div
            initial={{ opacity: 0, y: -20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8, ease: "easeOut" }}
            className="absolute top-0 left-0 right-0 z-10 p-6"
          >
            <nav className="flex justify-between items-center">
              <motion.div 
                className="text-xl font-bold text-stone-100"
                whileHover={{ scale: 1.05 }}
                whileTap={{ scale: 0.95 }}
              >
                JR AUTO DETAILING
              </motion.div>
              <div className="space-x-6">
                {['About', 'Services', 'Contact'].map((item, index) => (
                  <motion.button
                    key={item}
                    className="text-stone-300 hover:text-stone-100 transition-colors duration-300"
                    whileHover={{ scale: 1.1 }}
                    whileTap={{ scale: 0.95 }}
                    initial={{ opacity: 0, y: -20 }}
                    animate={{ opacity: 1, y: 0 }}
                    transition={{ duration: 0.5, delay: index * 0.1 }}
                  >
                    {item}
                  </motion.button>
                ))}
              </div>
            </nav>
          </motion.div>
        )}
      </AnimatePresence>
    </div>
  );
};

export default JRAutoDetailing;
